import React from "react";
export default function ShowWeather({weatherData}) {
    if (Object.keys(weatherData).length === 0) {
        return (
            <div className="showWeather">
            <div id="loading-weather-data">Loading</div>
            </div>
        )
    }

    return (
        <section className="showWeather">
            <h2 className="weather_heading">Weather Data for {weatherData.name}</h2>
            <h3 className="temp">Temperature in Farenheit: {weatherData.main.temp} degrees</h3>
            <div className="general_weather_data">
                <p id="pressure">Pressure: {weatherData.main.pressure} atm</p>
                <p>Visiblity: {weatherData.visiblity} atm</p>
            </div>
        </section>



    )

}
